import base64
import quopri
from bs4 import BeautifulSoup

def Content_process(string, email_delete_list, name_delete_list,contentTE,charset):
    if contentTE == "base64":
        decode_str = base64.b64decode(string)
    elif contentTE == "quoted-printable":
        decode_str = quopri.decodestring(string)
    else:
        print(f"==contentTE {contentTE} should be considered==")
    if charset==None:
        try:
            real_str = decode_str.decode("utf-8")
        except:
            real_str = decode_str.decode("gb2312")
    else:
        real_str = decode_str.decode(charset)
    # print(real_str)
    for email_delete in email_delete_list:
        real_str = real_str.replace(f"&lt;<a hre\nf=3D=\"mailto:{email_delete}>{email_delete}</a>&gt;;", "")
        real_str = real_str.replace(f"&lt;<a href=\"mailto:{email_delete}\">{email_delete}</a>&gt;;", "")
        real_str = real_str.replace(f"<a href=\"mailto:{email_delete}\">", "")
        real_str = real_str.replace(f"<a href=\"mailto:{email_delete}\" style=\"color: blue; text-decoration: underline;\"", "")
        real_str = real_str.replace(f"<{email_delete}>;", "")
        real_str = real_str.replace(f"&lt;{email_delete}&gt;;","")
        real_str = real_str.replace(email_delete, "")

    for name_delete in name_delete_list:
        real_str = real_str.replace(f"</span>{name_delete}<span lang=\"EN-US\">", "")
        real_str = real_str.replace(
            f"<span lang=\"EN-US\" style=\"font-family:&quot;Microsoft YaHei UI&quot;,sans-serif\"><span lang=\"EN-US\">{name_delete}</span></span></a>;",
            "")
        real_str = real_str.replace(f">{name_delete}</a>;", "")
        real_str = real_str.replace(f"\"{name_delete}\"", "")
        real_str = real_str.replace(name_delete, "")
    # print("===real_str===")
    # print(real_str)
    real_str2gbk = real_str.encode(charset)
    if contentTE == "base64":
        real_strreturn = base64.b64encode(real_str2gbk)
    elif contentTE == "quoted-printable":
        real_strreturn = quopri.encodestring(real_str2gbk)

    return real_strreturn


